import React from "react";
import { HeaderFontPreview } from "./headerFont";
import { FontList } from "./fontList";
import {FontPreviewProps} from "./fontPreviewProps";

export const OtherFont: React.FC<FontPreviewProps> = ({ previewText , fontSize, lineheight }) => {

    const fonts = [
        "Mon3",
        "Myanmar3",
        "MyanmarSansPro",
        "NotoSanMyanmar",
        "NotoSansMyanmarUI",
        "NotoSerifMyanmar",
        "Ours-Unicode",
        "Pyidaungsu",
        "Yunghkio",
        "MyMyanmarUniversal",
        "NotoZawDecode"
    ];

    return (
        <FontList title="Other Font Preview" previewText={previewText} fontSize={fontSize} data={fonts} lineheight={lineheight} />
    );
};
